		// פונקציה ליצירת האיייקון של הטיימר והגדרת מאפייני זמן לשאלה
		function CreateKitchenTimer() {
		    CreateBtn(lib.timer_new, 130, 142, "timer", gameContainer); // יצירת כפתור הטיימר והעלאתו לבמה
		
		    // כשיש הגבלת זמן:
		    // שמירת הזמן שנותר למענה על השאלה, בהתחלה יהיה הזמן שהמורה הגדירה
		    // כשאין הגבלת זמן:
		    // סופר את הזמן של כל המשחק - מתחיל מאפס וסופר במינוסים questionTimeRemain המשתנה 
		    questionTimeRemain = questionTime * 10;
		
		    var myTimer = gameContainer.getChildByName("timer") // שמירת קיצור לשעון העצר
		
		    var topNumTime; // המספר העליון שיופיע על הטיימר 
		
		    // מערך לשמירת השמות של תיבות הטקסט שנמצאות בתוך הסימבול של הטיימר, מראות את השניות
		    var timer_sec_txt_array = [myTimer.timerTXT_1, myTimer.timerTXT_2, myTimer.timerTXT_3, myTimer.timerTXT_4, myTimer.timerTXT_5, myTimer.timerTXT_0]
		
		    // אם יש הגבלת זמן
		    if (questionTime != 0) {
		        topNumTime = questionTime; // המספר הוא הזמן שהמורה הגדירה
		    }
		    // אם אין הגבלת זמן
		    else {
		        topNumTime = 60; // המספר הוא 60
		        myTimer.timerTXT_0.color = "#5A5A94"; // שינוי הצבע של ה60 לסגול
		    }
		
		    // לולאה להשמת השניות בתוך תיבות הטקסט
		    for (i = 0; i < timer_sec_txt_array.length; i++) {
		        timer_sec_txt_array[i].text = (topNumTime * (i + 1) / 6).toString();
		    }
		
		    // קריאה לפונקציה להפעלת הטיימר
		    CallTimerInterval();
		}
		
		
		// מופעלת כאשר נגמר הזמן לשאלה
		function TimeOut() {
		    clearInterval(timer); // עצירת האינטרוול של הטיימר
		    //DisableDistracts(); // מנטרלת לחיצה על כפתורי המסיחים
		
		    gameContainer.getChildByName("rolling_pin").visible = false; // מסתירה את השאלה
		    gameContainer.getChildByName("cutting_board").visible = false; // מסתירה את התשובות
		    stage.getChildByName("pause_btn").mouseEnabled = false; // מבטלת אפשרות לחיצה על עצירת משחק
		    stage.getChildByName("check_btn").visible = false; // מסתירה את הכפתור לבדיקת התשובה
		    //stage.getChildByName("progress_bar").visible = false; // מסתירה את הבית
		
		    // הוספת 30 שניות לזמן הסופי של המשחק
		    //totalTime += 30;
		    // הוספת הזמן של השאלה לזמן הסופי של המשחק
		    totalTime += questionTime;
		
		    // מעלה את מספר השגיאות הכולל במשחק ב-1
		    // כשנגמר הזמן - זה נחשב לטעות של השחקנית, וזה נספר בכמות הטעויות
		    totalMistakes++;
		    // מעלה את מספר נסיונות המענה של השאלה הנוכחית ב-1
		    allQuestionsArray[qnum].tryCounter++;
		
		    //הוספת רקע של נגמר הזמן
		    CreateBtn(lib.time_out_bg, 0, 0, "time_out_bg", gameContainer);
		
		    // יצירת "כפתור" בגודל קרש החיתוך שיחזיק את העוגיות השרופות
		    CreateBtn(lib.burnt_board, 75, 287, "burnt_board", gameContainer);
		    var burnt_board = gameContainer.getChildByName("burnt_board"); // שמירת קיצור
		
		    // הוספת עוגיות שרופות כמספר המסיחים 
		    for (var i = 0; i < randomAnswersArray2D.length; i++) {
		        CreateBtn(lib.burnt_cookie, btnXarr[i], btnYarr[i], "burnt_cookie" + i, burnt_board); // יצירת עוגיה שרופה
		    }
		
		    DrawRandomQuestion(); // מגרילה שאלה חדשה
		    CreateNextButton(); // כפתור המשך לשאלה חדשה
		    gameContainer.getChildByName("next_btn").outputTXT.text = "להמשיך";
		}
		
		
		
